import React from 'react';
import './App.css';
import Compass from "./components/compass"
import Wind from "./components/wind"



class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {heading: 0};
  }

  componentDidMount() {
  }

  render() {
    return (
      <div>
        <div className="table">
          <Wind width={250} height={250} />
          <Compass width={250} height={250} heading={this.state.heading} />
        </div>
        <div className="table">
          <Wind width={500} height={500} />
        </div>
      </div>
    );
  }
}

export default App;
